interface IERC20 {
    function transfer(address to, uint256 value) external returns (bool);
}

contract Market {
    constructor() payable {
        // 数组0的位置填充空结构体
        Block memory blk0 = Block(0, 1, payable(address(0)), address(0), 1, 1);
        blocks.push(blk0);
        fee = 1000;
        addRate = 10000;
        maxId = 2000;
        owner = msg.sender;
        lockLimit = 200;
        priceRateMin = 80;
        priceRateMax = 300;
        // 应该可以不写，uint初始为0
        // usersWithrefNum = 0;
        referrerOpen = true;
        referrerNeedAmount = 3;
        referrerRewardCreate = 2000;
        referrerRewardBuy = 200;
        userBenefitCreate = 501;
        userBenefitBuy = 51;
    }

    // 以下为推荐人机制相关代码

    ///用户，推荐人，映射
    mapping(address => address) users2refs;
    address[] usersWithref;
    uint256 usersWithrefNum;

    ///推荐人机制是否开启
    bool referrerOpen;
    ///推荐人拥有blocks达到此数才生效
    uint256 referrerNeedAmount;
    ///创建blocks时推荐人获得的奖励，初始为20%；即2000。
    uint256 referrerRewardCreate;
    ///购买blocks时推荐人获得的奖励
    uint256 referrerRewardBuy;
    ///拥有推荐人的地址，创建区块时享有的折扣，初始为5%，即500。改为501。
    uint256 userBenefitCreate;
    ///拥有推荐人的地址，购买区块时享有的折扣，初始为5%，即500。改为501。
    uint256 userBenefitBuy;

    function setReferrerOpen(bool _bool) public onlyOwner {
        referrerOpen = _bool;
    }

    function setReferrerNeedAmount(uint256 _uint) public onlyOwner {
        referrerNeedAmount = _uint;
    }

    function setReferrerRewardCreate(uint256 _uint) public onlyOwner {
        referrerRewardCreate = _uint;
    }

    function setReferrerRewardBuy(uint256 _uint) public onlyOwner {
        referrerRewardBuy = _uint;
    }

    function setUser2referrer(address _address) public {
        users2refs[msg.sender] = _address;
    }

    function getReferrerOpen() public view returns (bool) {
        return referrerOpen;
    }

    function getReferrerNeedAmount() public view returns (uint256) {
        return referrerNeedAmount;
    }

    function getReferrerRewardCreate() public view returns (uint256) {
        return referrerRewardCreate;
    }

    function getReferrerRewardBuy() public view returns (uint256) {
        return referrerRewardBuy;
    }

    function getUser2referrer(address _address) public view returns (address) {
        return users2refs[_address];
    }

    function getHowManyBlocksReferrerHas(address _address)
        public
        view
        returns (uint256)
    {
        uint256 howMany;
        for (uint256 i = 1; i < blocks.length; i++) {
            if (blocks[i].referrer == _address) {
                howMany += 1;
            }
        }
        return howMany;
    }

    // 以上为推荐人机制相关代码

    // 判断是否适用推荐人机制奖励

    function whetherUseReferrer() public view returns (bool) {
        return
            users2refs[msg.sender] != address(0) &&
            referrerOpen &&
            getHowManyBlocksReferrerHas(users2refs[msg.sender]) >=
            referrerNeedAmount;
    }

    function whetherUseReferrerWithAddress(address _address)
        public
        view
        returns (bool)
    {
        return
            referrerOpen &&
            getHowManyBlocksReferrerHas(users2refs[_address]) >=
            referrerNeedAmount;
    }

    //priceRate，和basic相乘，就是实际价格。初始为80-300，即0.8折至3倍。

    uint256 priceRateMin;
    uint256 priceRateMax;

    function setPriceRateMin(uint256 _priceRateMin) public onlyOwner {
        priceRateMin = _priceRateMin;
    }

    function setPriceRateMax(uint256 _priceRateMax) public onlyOwner {
        priceRateMax = _priceRateMax;
    }

    //可以就用setPriceRateArr，测试下手续费差别大不
    function setPriceRateAll(uint256 _priceRate) public {
        require(
            _priceRate >= priceRateMin && _priceRate <= priceRateMax,
            "priceRate out of range"
        );
        aimIds = emptyArr;
        for (uint256 i = 0; i < blocks.length; i++) {
            if (blocks[i].blockOwner == msg.sender) {
                aimIds.push(blocks[i].id);
            }
        }
        require(aimIds.length > 0, "you don't own any of the block");
        for (uint256 i = 0; i < aimIds.length; i++) {
            blocks[arrayIndex[aimIds[i]]].priceRate = _priceRate;
        }
    }

    function setPriceRateArr(uint256 _priceRate, uint256[] memory _ids) public {
        require(
            _priceRate >= priceRateMin && _priceRate <= priceRateMax,
            "priceRate out of range"
        );
        for (uint256 i = 0; i < _ids.length; i++) {
            blocks[arrayIndex[_ids[i]]].priceRate = _priceRate;
        }
    }

    //以下是为了设置lock新增的代码
    uint256 lockLimit;
    ///购买一个address所有ids时所记录的ids。
    uint256[] aimIds;
    uint256[] emptyArr;
    mapping(address => bool) whetherLock;

    function setLockTrue() public {
        whetherLock[msg.sender] = true;
    }

    function setLockFalse() public {
        whetherLock[msg.sender] = false;
    }

    function getLock(address _address) public view returns (bool _bool) {
        return whetherLock[_address];
    }

    function setLimit(uint256 _lockLimit) public onlyOwner {
        lockLimit = _lockLimit;
    }

    function getOwnedQtt(address _address)
        public
        view
        returns (uint256 _ownedQtt)
    {
        for (uint256 i = 0; i < blocks.length; i++) {
            if (blocks[i].blockOwner == _address) {
                _ownedQtt++;
            }
        }
        return _ownedQtt;
    }

    //以上是为了设置lock新增的代码
    address public owner;

    uint256 maxId;

    modifier onlyOwner() {
        require(msg.sender == owner, "not owner");
        _;
    }

    function setMaxId(uint256 _maxId) public onlyOwner {
        require(_maxId <= 1000000, "maxId out of range");
        maxId = _maxId;
    }

    // 购买已有owner的block时的费率。1000为收10%，10000为收100%
    uint256 fee;

    // 创建新block时候所需支付的费用，10000为1个block1个币。20000为1个block2个币
    uint256 addRate;

    function setAddRate(uint256 _addRate) public onlyOwner {
        require(_addRate <= 100000000, "fee out of range");
        addRate = _addRate;
    }

    // function setPriceRateMin()

    function setFee(uint256 _fee) public onlyOwner {
        // require(msg.sender == owner, "you dont have the right to set the fee");
        // require(
        //     msg.sender == 0xdD870fA1b7C4700F2BD7f44238821C26f7392148,
        //     "you dont have the right to set the fee"
        // );
        require(fee <= 10000, "fee out of range");
        fee = _fee;
    }

    struct Block {
        uint256 id;
        uint256 colorNum;
        address payable blockOwner;
        address referrer;
        uint256 basicPrice;
        uint256 priceRate;
    }

    //add,第一个uint是id,第二个uint是此id为第几个增加的.
    mapping(uint256 => uint256) arrayIndex;

    // 将所有Block存在blocks数组中。按添加顺序而非id排列
    Block[] blocks;

    // addInArr中使用的id数组
    uint256[] ids;

    event Log(string message, uint256 val);

    function ex() external {
        emit Log("test", 250);
    }

    //以数组方式批量add blocks，判断更严格，稍微多消耗gas
    function addWithArr(uint256[] memory _ids, uint256 _colorNum)
        public
        payable
    {
        require(idOutRange(_ids), "at least one id out of range");
        require(_colorNum < 126 && _colorNum != 0, "colorNum out of range");

        bool shifou;
        for (uint256 i = 0; i < _ids.length; i++) {
            if (haveId(_ids[i])) {
                shifou = true;
                break;
            }
        }

        if (!shifou) {
            if (whetherUseReferrer()) {
                // payable(users2refs[msg.sender]).transfer(
                //     _ids.length * 10**14 * referrerRewardCreate
                // );
                // payable(owner).transfer(
                //     _ids.length *
                //         10**14 *
                //         (addRate - referrerRewardCreate - userBenefitCreate)
                // );
                IERC20(0x0000000000000000000000000000000000000802).transfer(
                    users2refs[msg.sender],
                    _ids.length * 10**11 * referrerRewardCreate
                );
                IERC20(0x0000000000000000000000000000000000000802).transfer(
                    owner,
                    _ids.length *
                        10**11 *
                        (addRate - referrerRewardCreate - userBenefitCreate)
                );

                for (uint256 i = 0; i < _ids.length; i++) {
                    if (!haveId(_ids[i])) {
                        arrayIndex[_ids[i]] = blocks.length;
                        Block memory blk = Block(
                            _ids[i],
                            _colorNum,
                            payable(msg.sender),
                            users2refs[msg.sender],
                            200,
                            100
                        );
                        blocks.push(blk);
                    }
                }
            } else {
                // payable(owner).transfer(_ids.length * 10**14 * addRate);
                IERC20(0x0000000000000000000000000000000000000802).transfer(
                    owner,
                    _ids.length * 10**11 * addRate
                );
                for (uint256 i = 0; i < _ids.length; i++) {
                    if (!haveId(_ids[i])) {
                        arrayIndex[_ids[i]] = blocks.length;
                        Block memory blk = Block(
                            _ids[i],
                            _colorNum,
                            payable(msg.sender),
                            users2refs[msg.sender],
                            200,
                            100
                        );
                        blocks.push(blk);
                    }
                }
            }
        }
    }

    // 以数组方式批量add blocks，判断不严格，较少消耗gas
    // function addWithArr2(uint256[] memory _ids, uint256 _colorNum)
    //     public
    //     payable
    // {
    //     require(idOutRange(_ids), "at least one id out of range");
    //     require(_colorNum < 126 && _colorNum != 0, "colorNum out of range");
    //     payable(0xe24399CE9Ab1B6766C6336eD56ba10a8A4017686).transfer(
    //         _ids.length * 10**18
    //     );

    //     for (uint256 i = 0; i < _ids.length; i++) {
    //         if (!haveId(_ids[i])) {
    //             arrayIndex[_ids[i]] = blocks.length;
    //             Block memory blk = Block(
    //                 _ids[i],
    //                 _colorNum,
    //                 payable(msg.sender),
    //                 2
    //             );
    //             blocks.push(blk);
    //         } else {
    //             continue;
    //         }
    //     }
    // }

    // blocks所有者将自己拥有的blocks转移给其它地址
    function transferWithArr(uint256[] memory _ids, address payable _receiver)
        public
    {
        // for (uint256 i = 0; i < _ids.length; i++) {
        //     require(
        //         msg.sender == blocks[arrayIndex[_ids[i]]].blockOwner,
        //         "at least one block is not owned by you"
        //     );
        //     blocks[arrayIndex[_ids[i]]].blockOwner = _receiver;
        // }

        // 试试两种方法gas消耗。
        for (uint256 i = 0; i < _ids.length; i++) {
            require(
                msg.sender == blocks[arrayIndex[_ids[i]]].blockOwner,
                "at least one block is not owned by you"
            );
        }
        for (uint256 i = 0; i < _ids.length; i++) {
            blocks[arrayIndex[_ids[i]]].blockOwner = _receiver;
            blocks[arrayIndex[_ids[i]]].referrer = users2refs[_receiver];
        }
    }

    // function changeRealPrice() {}

    //用于addBlock判断mapping中是否已有新输入的id。
    function haveId(uint256 _id) public view returns (bool) {
        return arrayIndex[_id] > 0;
    }

    // 修改已有的block的color编号
    function changeColorNum(uint256 _id, uint256 _colorNum) public {
        // Block storage/memory blk;
        // blk = blocks[arrayIndex[_id]];
        // 暂不知道这样简写行不行，所以先用blocks[arrayIndex[_id]]，确认能简写后再改为blk。
        require(0 < _colorNum && _colorNum < 4, "colorNum out of range");
        require(msg.sender == blocks[arrayIndex[_id]].blockOwner, "not owner");
        blocks[arrayIndex[_id]].colorNum = _colorNum;
    }

    function changeColorNumWithArr(uint256[] memory _ids, uint256 _colorNum)
        public
    {
        for (uint256 i = 0; i < _ids.length; i++) {
            require(
                blocks[arrayIndex[_ids[i]]].blockOwner == msg.sender,
                "the blocks you choose are not all owned by you"
            );
        }

        for (uint256 i = 0; i < _ids.length; i++) {
            blocks[arrayIndex[_ids[i]]].colorNum = _colorNum;
        }
    }

    function buyBlocks(uint256[] memory _ids, uint256 _colorNum)
        public
        payable
    {
        //可以尝试下有没有更省手续费的方法。
        address originOwner;
        originOwner = blocks[arrayIndex[_ids[0]]].blockOwner;
        require(
            msg.sender != originOwner,
            "you already owned at least one of the seletcted blocks"
        );
        for (uint256 i = 0; i < _ids.length; i++) {
            require(
                blocks[arrayIndex[_ids[i]]].blockOwner == originOwner,
                "you have to select blocks with the same owner"
            );
        }
        require(
            getOwnedQtt(originOwner) > lockLimit || !getLock(originOwner),
            "the originOwner locked it's blocks, you have to buy his/her blocks all at once"
        );
        uint256 totalPay;
        for (uint256 i = 0; i < _ids.length; i++) {
            totalPay +=
                blocks[arrayIndex[_ids[i]]].basicPrice *
                blocks[arrayIndex[_ids[i]]].priceRate;
        }
        if (whetherUseReferrer()) {
            // payable(originOwner).transfer(totalPay * 10**10 * (10000 - fee));
            IERC20(0x0000000000000000000000000000000000000802).transfer(
                originOwner,
                totalPay * 10**7 * (10000 - fee)
            );
            // payable(users2refs[msg.sender]).transfer(
            //     totalPay * 10**10 * referrerRewardBuy
            // );

            IERC20(0x0000000000000000000000000000000000000802).transfer(
                users2refs[msg.sender],
                totalPay * 10**7 * referrerRewardBuy
            );

            // payable(owner).transfer(
            //     totalPay * 10**10 * (fee - userBenefitBuy - referrerRewardBuy)
            // );

            IERC20(0x0000000000000000000000000000000000000802).transfer(
                owner,
                totalPay * 10**7 * (fee - userBenefitBuy - referrerRewardBuy)
            );
        } else {
            // payable(originOwner).transfer(totalPay * 10**10 * (10000 - fee));

            IERC20(0x0000000000000000000000000000000000000802).transfer(
                originOwner,
                totalPay * 10**7 * (10000 - fee)
            );
            // payable(owner).transfer(totalPay * 10**10 * fee);
            IERC20(0x0000000000000000000000000000000000000802).transfer(
                owner,
                totalPay * 10**7 * fee
            );
        }
        for (uint256 i = 0; i < _ids.length; i++) {
            blocks[arrayIndex[_ids[i]]].blockOwner = payable(msg.sender);
            blocks[arrayIndex[_ids[i]]].referrer = users2refs[msg.sender];
            blocks[arrayIndex[_ids[i]]].colorNum = _colorNum;
            blocks[arrayIndex[_ids[i]]].basicPrice =
                (blocks[arrayIndex[_ids[i]]].basicPrice *
                    blocks[arrayIndex[_ids[i]]].priceRate) /
                100;
        }
    }

    // function buyBlocksFromAnAddress(address _address) public payable {
    //     require(msg.sender != _address, "you can't buy your own blocks!");
    //     // uint256[] memory aimIds;
    //     aimIds = emptyArr;

    //     uint256 totalPay;
    //     for (uint256 i = 0; i < blocks.length; i++) {
    //         if (blocks[i].blockOwner == _address) {
    //             aimIds.push(blocks[i].id);
    //         }
    //         totalPay +=
    //             blocks[arrayIndex[aimIds[i]]].basicPrice *
    //             blocks[arrayIndex[aimIds[i]]].priceRate;
    //     }
    //     payable(_address).transfer(totalPay * 10**10 * (10000 - fee));
    //     payable(owner).transfer(totalPay * 10**10 * (fee - referrerRewardBuy));
    //     payable(users2refs[msg.sender]).transfer(
    //         totalPay * 10**10 * referrerRewardBuy
    //     );
    //     for (uint256 i = 0; i < aimIds.length; i++) {
    //         blocks[arrayIndex[aimIds[i]]].blockOwner = payable(msg.sender);
    //         blocks[arrayIndex[aimIds[i]]].referrer = users2refs[msg.sender];
    //         blocks[arrayIndex[aimIds[i]]].basicPrice =
    //             (blocks[arrayIndex[aimIds[i]]].basicPrice *
    //                 blocks[arrayIndex[aimIds[i]]].priceRate) /
    //             100;
    //     }
    // }

    function buyBlocksFromAnAddress(address _address) public payable {
        require(msg.sender != _address, "you can't buy your own blocks!");
        // uint256[] memory aimIds;
        aimIds = emptyArr;

        uint256 totalPay;
        for (uint256 i = 0; i < blocks.length; i++) {
            if (blocks[i].blockOwner == _address) {
                aimIds.push(blocks[i].id);
            }
            totalPay +=
                blocks[arrayIndex[aimIds[i]]].basicPrice *
                blocks[arrayIndex[aimIds[i]]].priceRate;
        }
        payable(_address).transfer(totalPay * 10**10 * (10000 - fee));
        payable(owner).transfer(totalPay * 10**10 * (fee - referrerRewardBuy));
        payable(users2refs[msg.sender]).transfer(
            totalPay * 10**10 * referrerRewardBuy
        );
        for (uint256 i = 0; i < aimIds.length; i++) {
            blocks[arrayIndex[aimIds[i]]].blockOwner = payable(msg.sender);
            blocks[arrayIndex[aimIds[i]]].referrer = users2refs[msg.sender];
            blocks[arrayIndex[aimIds[i]]].basicPrice =
                (blocks[arrayIndex[aimIds[i]]].basicPrice *
                    blocks[arrayIndex[aimIds[i]]].priceRate) /
                100;
        }
    }

    function getBlocks() public view returns (Block[] memory) {
        return blocks;
    }

    // 判断以数组方式添加blocks时，是否每个元素id都未超过范围
    function idOutRange(uint256[] memory _ids) public view returns (bool) {
        bool shifou;
        for (uint256 i = 0; i < _ids.length; i++) {
            if (_ids[i] > maxId) {
                shifou = false;
                break;
            } else {
                shifou = true;
            }
        }
        return shifou;
    }

    function getOwnerById(uint256 _id) public view returns (address) {
        return blocks[arrayIndex[_id]].blockOwner;
    }

    function getPriceById(uint256 _id) public view returns (uint256) {
        return
            blocks[arrayIndex[_id]].basicPrice *
            blocks[arrayIndex[_id]].priceRate;
    }

    function getBasicPriceById(uint256 _id) public view returns (uint256) {
        return blocks[arrayIndex[_id]].basicPrice;
    }

    function getPriceRateById(uint256 _id) public view returns (uint256) {
        return blocks[arrayIndex[_id]].priceRate;
    }

    //暂不知道会不会用到
    function getColorNumById(uint256 _id) public view returns (uint256) {
        return blocks[arrayIndex[_id]].colorNum;
    }
}

